import React, { useState, useEffect } from 'react';

function EventList() {
  const [events, setEvents] = useState([]);

  useEffect(() => {
    fetch('https://localhost:7234/DanceEvent')
      .then(response => response.json())
      .then(data => setEvents(data));
  }, []);

  return (
    <div>
      <h2>Lista Wydarzeń</h2>
      <ul>
        {events.map(event => (
          <li key={event.id}>{event.name}</li>
        ))}
      </ul>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <a className="navbar-brand" href="#">Logo</a>
        <ul className="navbar-nav ml-auto">
          <li className="nav-item">
            <a className="nav-link" href="#">Zaloguj</a>
          </li>
        </ul>
      </nav>
      <div className="container mt-4">
        <div className="row">
          <div className="col-md-3">
            <div className="form-group">
              <label htmlFor="filtr">Filtruj:</label>
              <input type="text" id="filtr" className="form-control" />
            </div>
          </div>
          <div className="col-md-9">
            <EventList /> {/* Dodaj komponent EventList, który wyświetli wydarzenia */}
          </div>
        </div>
      </div>
      <footer className="footer mt-4">
        <div className="container">
          <p>&copy; 2023 Nazwa Twojej Strony</p>
        </div>
      </footer>
    </div>
  );
}

export default App;
